import React from 'react';
import { Button, ThemeProvider, createMuiTheme } from '@material-ui/core';

function App() {
  const theme = createMuiTheme({
    status: {
      danger: orange[500],
    }
  })
  return(
    <ThemeProvider theme={theme}>
      <Button variant="contained" color="primary" >Jones
      </Button>
      </ThemeProvider>
  );
}

export default App;
